I always tell our athletes we work with to be coachable but don’t be a pleaser. 

A pleaser on the court is someone that shoots not to miss rather than shooting with extreme confidence and belief that everything is going in. A pleaser tightens up after they miss a couple shots rather than having an extreme short memory for misses.  A pleaser is worried about what their coach and teammates think of them rather than having extreme belief in one’s self and the value your roll brings to the team.  A pleaser second guesses themselves on the court rather than having extreme preparation and knowledge of their position and the overall IQ of the game.

@stephencurry30 plays the game with confidence, freedom and joy.  You can’t expect your coach and teammates to believe in you if you don’t have 100% belief in yourself.  Confidence comes from being prepared📈

